import React from 'react';
import { Navbar } from 'react-bootstrap';

const Nav = ({
    params,
}) => (
  <Navbar bg="light">
    <Navbar.Brand href="#home">AwesomePokedexk</Navbar.Brand>
  </Navbar>
);

export default Nav;
